body {
    font-family: 'Times New Roman', serif;
    line-height: 1.6;
    background-color: #f5f5f5;
    margin: 0;
    padding: 20px;
}

.profile h1 {
    color: #333;
    text-align: center;
}


.activities-grid {
    column-gap: 20px; /* Space between columns */
    margin: 20px auto; /* Centers the grid horizontally */
    column-count: 1; /* Default to 1 column for mobile */
}

/* Responsive columns for larger screens */
@media (min-width: 1441px) {
    .activities-grid {
        column-count: 3; /* Adjust the number of columns as needed for larger screens */
    }
}

/* You can still include other breakpoints for intermediate devices like tablets or small desktops */
@media (min-width: 768px) and (max-width: 1440px) {
    .activities-grid {
        column-count: 2; /* Example for intermediate screens such as tablets */
    }
}

.activity {
    background-color: white;
    padding: 15px;
    border: 1px solid #ddd;
    border-radius: 5px;
    margin-bottom: 20px; /* Space between activities */
    break-inside: avoid; /* Prevents columns from breaking inside an activity */
    page-break-inside: avoid; /* For older browsers */
}

.activity h3 {
    color: #555;
}

.activity p {
    color: #666;
}

.activity small {
    color: #888;
}

.activity img {
    max-width: 100%; /* Ensures the image is not wider than its container */
    height: auto; /* Ensures the height is scaled proportionally */
    object-fit: contain; /* Ensures the image is scaled to be contained within the frame, without distorting its aspect ratio */
}


blockquote {
    padding: 20px;
    margin: 0 0 20px 0;
    border-left: 4px solid #ccc;
    background-color: #f9f9f9;
    font-style: italic;
    overflow: hidden; /* In case of long quotes not breaking properly */
}

blockquote p {
    margin: 0; /* Remove default paragraph margins */
}

footer {
    text-align: center;
